    async function getCameraDevices() {
      const frontCameras = []
      const backCameras = []

      let devices = await navigator.mediaDevices.enumerateDevices()
      // if permission is not given, label of video devices will be empty string
      if (
        devices
          .filter(device => device.kind === 'videoinput')
          .every(device => device.label === '')
      ) {
        const stream = await navigator.mediaDevices.getUserMedia({
          video: {
            facingMode: { ideal: 'environment' },
          },
          audio: false,
        })

        // enumerate devices again - now the label field should be non-empty, as we have a stream active
        // (even if we didn't get persistent permission for camera)
        devices = await navigator.mediaDevices.enumerateDevices()

        // close the stream, as we don't need it anymore
        stream.getTracks().forEach(track => track.stop())
      }

      const cameras = devices.filter(device => device.kind === 'videoinput')
      console.log("%c Line:62 ü•í devices", "color:#42b983", {devices,cameras});
      return cameras
    }

    async function initUserMedia(constraints) {
      return new Promise(async (resolve, reject) => {
        let tryCount = 0
        const maxTryCount = 5
        async function tryGetStream() {
          try {
            const stream = await navigator.mediaDevices.getUserMedia(constraints)
            console.log("%c Line:113 üç© stream", "color:#ed9ec7", stream);
            resolve(stream)
          } catch (error) {
            tryCount++
            if (tryCount < maxTryCount) {
              setTimeout(tryGetStream, 500) // 0.5s after retry
            } else {
              reject(error)
            }
          }
        }
        tryGetStream()
      })
    }

    async function getMediaStream(constraints) {
      const ts = Date.now()
      const getMediaStartTime = ts
      try {
        if (!constraints) {
          const cameras = await getCameraDevices()
          constraints.video = cameras[0].deviceId
        }
        const stream = await initUserMedia(constraints)
        const resTs = Date.now()
        this.stream = stream
        return [stream]
      } catch (error) {
        console.error(`camera error`, error)
      }
    }
